Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 3831/90 of 20 December 1990 applying generalized tariff preferences for 1991 in respect of certain industrial products originating in developing countries (1), extended into 1992 by Regulation (EEC) No  3587/91 (2), and in particular Article 9 thereof,
Whereas, pursuant to Articles 1 and 6 of that Regulation (EEC) No 3831/90, suspension of customs duties shall be accorded to each of the countries or territories listed in Annex III other than those listed in column 4 of Annex I within the framework of  the preferential tariff ceilings fixed in column 6 of Annex I;
Whereas, as provided for in Article 7 of that Regulation, as soon as the individual ceilings in question are reached at Community level, the levying of customs duties on imports of the products in question originating in each of the countries and  territories concerned may at any time be re-established;
Whereas, in the case of products falling within CN code 9403 80 00, originating in Indonesia and the Philippines, the individual ceiling was fixed at 2 431 000; whereas, on 29 April 1992, imports of these products into the Community originating in  Indonesia and the Philippines reached the ceiling in question after being charged thereagainst; whereas, it is appropriate to re-establish the levying of customs duties in respect of the products in question against Indonesia and the Philippines,
